import React from 'react';
import { ClearButton, Container } from './../shared/global';
import styled from 'styled-components';

const Modal = styled.div`
	background-color: #fff;
	position: absolute;
	top: 10vh;
	left: 0;
	right: 0;
	border: #ccc solid 1px;
	margin: 1rem auto;
	width: 100%;
	max-width: 1000px;
	padding: 1rem;
	border-radius: 5px;
	height: 80vh;
	overflow-x: scroll;
`;

const StyledButton = styled(ClearButton)`
	position: relative;
`;

const GuidebookModal = () => {
	return (
		<Container>
			<StyledButton>View Guidebook</StyledButton>
			<Modal>Hello this is the modal</Modal>
		</Container>
	);
};

export default GuidebookModal;
